  ['switch_20a_20k_20a_20off_20on_20dimmer_20a_20k_20a_20off_20on_20volume_20radio_20switch_20s_20daldd_20mpb_77',['SldrDALtchMPBttn models a Slider Double Action LDD-MPB combo switch, a.k.a. Off/On/Dimmer, a.k.a. Off/On/Volume radio switch (&lt;b&gt;S-DALDD-MPB&lt;/b&gt;)',['../C:/Users/DevPadawan/Documents/My Projects/Training Projects/LibsDev_AVR/lib/ButtonToSwitch_AVR/README.md#sldrdaltchmpbttn-models-a-slider-double-action-ldd-mpb-combo-switch-aka-offondimmer-aka-offonvolume-radio-switch-s-daldd-mpb',1,'']]],
  ['switch_20dd_20daldd_20mpb_78',['DDlydDALtchMPBttn models a Debounced Delayed Double Action Latched MPB combo switch (&lt;b&gt;DD-DALDD-MPB&lt;/b&gt;).',['../C:/Users/DevPadawan/Documents/My Projects/Training Projects/LibsDev_AVR/lib/ButtonToSwitch_AVR/README.md#ddlyddaltchmpbttn-models-a-debounced-delayed-double-action-latched-mpb-combo-switch-dd-daldd-mpb',1,'']]],
  ['switch_20enters_20the_20on_20state_20are_20started_20that_20means_20setting_20the_20ison_20attribute_20flag_20and_20calling_20the_20fnwhntrnon_20function_20the_20driving_20concept_20is_20to_20instantiate_20a_20mpbttn_20that_20generates_20only_20one_20possible_20ison_20attribute_20flag_20true_20readout_20and_20the_20associated_20function_20execution_20just_20like_20a_20single_20shot_20trigger_79',['The &lt;b&gt;Single Service Voidable Momentary Push Button&lt;/b&gt; keeps the &lt;b&gt;On state&lt;/b&gt; since the moment the signal is stable (debounce &amp;amp; delay process) and until the moment the provided mechanisms implemented to be executed when the switch enters the &lt;b&gt;On State&lt;/b&gt; are started, that means setting the &lt;b&gt;isOn&lt;/b&gt; attribute flag and calling the &lt;b&gt;fnWhnTrnOn&lt;/b&gt; function. The driving concept is to instantiate a MPBttn that generates only one possible &lt;b&gt;isOn&lt;/b&gt; attribute flag true readout and the associated function execution, just like a single shot trigger.',['../C:/Users/DevPadawan/Documents/My Projects/Training Projects/LibsDev_AVR/lib/ButtonToSwitch_AVR/README.md#the-single-service-voidable-momentary-push-button-keeps-the-on-state-since-the-moment-the-signal-is-stable-debounce--delay-process-and-until-the-moment-the-provided-mechanisms-implemented-to-be-executed-when-the-switch-enters-the-on-state-are-started-that-means-setting-the-ison-attribute-flag-and-calling-the-fnwhntrnon-function-the-driving-concept-is-to-instantiate-a-mpbttn-that-generates-only-one-possible-ison-attribute-flag-true-readout-and-the-associated-function-execution-just-like-a-single-shot-trigger',1,'']]],
  ['switch_20is_20off_80',['The &lt;b&gt;Hinted Timer Latched&lt;/b&gt;, or &lt;b&gt;Staircase Timer Switch&lt;/b&gt;, keeps the ON state since the moment the signal is debounced, and keeps the state during a set time, has the capability to give a warning when the service time is close to the end and the possibility to set a third signal ON while the switch is off.',['../C:/Users/DevPadawan/Documents/My Projects/Training Projects/LibsDev_AVR/lib/ButtonToSwitch_AVR/README.md#the-hinted-timer-latched-or-staircase-timer-switch-keeps-the-on-state-since-the-moment-the-signal-is-debounced-and-keeps-the-state-during-a-set-time-has-the-capability-to-give-a-warning-when-the-service-time-is-close-to-the-end-and-the-possibility-to-set-a-third-signal-on-while-the-switch-is-off',1,'']]],
  ['switch_20is_20on_20or_20off_81',['- &lt;em&gt;Start asking if the switch is On or Off.&lt;/em&gt;',['../C:/Users/DevPadawan/Documents/My Projects/Training Projects/LibsDev_AVR/lib/ButtonToSwitch_AVR/README.md#autotoc_md--_start-asking-if-the-switch-is-on-or-off_',1,'']]],
  ['switch_20keeps_20the_20on_20state_20since_20the_20moment_20the_20signal_20is_20debounced_20and_20delayed_20and_20keeps_20the_20on_20state_20during_20a_20set_20time_20after_20wich_20it_20atomatically_20returns_20to_20the_20off_20state_82',['The &lt;b&gt;Time latched Switch&lt;/b&gt; or &lt;b&gt;Timer Switch&lt;/b&gt; keeps the ON state &lt;b&gt;since the moment the signal is debounced and delayed&lt;/b&gt;, and keeps the ON state during a set time, after wich it atomatically returns to the OFF state.',['../C:/Users/DevPadawan/Documents/My Projects/Training Projects/LibsDev_AVR/lib/ButtonToSwitch_AVR/README.md#the-time-latched-switch-or-timer-switch-keeps-the-on-state-since-the-moment-the-signal-is-debounced-and-delayed-and-keeps-the-on-state-during-a-set-time-after-wich-it-atomatically-returns-to-the-off-state',1,'']]],
  ['switch_20keeps_20the_20on_20state_20since_20the_20moment_20the_20signal_20is_20debounced_20and_20keeps_20the_20state_20during_20a_20set_20time_20has_20the_20capability_20to_20give_20a_20warning_20when_20the_20service_20time_20is_20close_20to_20the_20end_20and_20the_20possibility_20to_20set_20a_20third_20signal_20on_20while_20the_20switch_20is_20off_83',['The &lt;b&gt;Hinted Timer Latched&lt;/b&gt;, or &lt;b&gt;Staircase Timer Switch&lt;/b&gt;, keeps the ON state since the moment the signal is debounced, and keeps the state during a set time, has the capability to give a warning when the service time is close to the end and the possibility to set a third signal ON while the switch is off.',['../C:/Users/DevPadawan/Documents/My Projects/Training Projects/LibsDev_AVR/lib/ButtonToSwitch_AVR/README.md#the-hinted-timer-latched-or-staircase-timer-switch-keeps-the-on-state-since-the-moment-the-signal-is-debounced-and-keeps-the-state-during-a-set-time-has-the-capability-to-give-a-warning-when-the-service-time-is-close-to-the-end-and-the-possibility-to-set-a-third-signal-on-while-the-switch-is-off',1,'']]],
  ['switch_20keeps_20the_20on_20state_20since_20the_20moment_20the_20signal_20is_20stable_20debouncing_20delay_20process_20and_20keeps_20the_20on_20state_20after_20the_20push_20button_20is_20released_20and_20until_20it_20is_20pressed_20once_20again_84',['The &lt;b&gt;Toggle switch&lt;/b&gt; keeps the ON state since the moment the signal is stable (debouncing + Delay process), and keeps the ON state after the push button is released and until it is pressed once again.',['../C:/Users/DevPadawan/Documents/My Projects/Training Projects/LibsDev_AVR/lib/ButtonToSwitch_AVR/README.md#the-toggle-switch--keeps-the-on-state-since-the-moment-the-signal-is-stable-debouncing--delay-process-and-keeps-the-on-state-after-the-push-button-is-released-and-until-it-is-pressed-once-again',1,'']]],
  ['switch_20mechanisms_20replacements_20out_20of_20simple_20push_20buttons_85',['An Arduino library that builds switch mechanisms replacements out of simple push buttons.',['../C:/Users/DevPadawan/Documents/My Projects/Training Projects/LibsDev_AVR/lib/ButtonToSwitch_AVR/README.md#an-arduino-library-that-builds-switch-mechanisms-replacements-out-of-simple-push-buttons',1,'']]],
  ['switch_20or_20timer_20switch_20keeps_20the_20on_20state_20since_20the_20moment_20the_20signal_20is_20debounced_20and_20delayed_20and_20keeps_20the_20on_20state_20during_20a_20set_20time_20after_20wich_20it_20atomatically_20returns_20to_20the_20off_20state_86',['The &lt;b&gt;Time latched Switch&lt;/b&gt; or &lt;b&gt;Timer Switch&lt;/b&gt; keeps the ON state &lt;b&gt;since the moment the signal is debounced and delayed&lt;/b&gt;, and keeps the ON state during a set time, after wich it atomatically returns to the OFF state.',['../C:/Users/DevPadawan/Documents/My Projects/Training Projects/LibsDev_AVR/lib/ButtonToSwitch_AVR/README.md#the-time-latched-switch-or-timer-switch-keeps-the-on-state-since-the-moment-the-signal-is-debounced-and-delayed-and-keeps-the-on-state-during-a-set-time-after-wich-it-atomatically-returns-to-the-off-state',1,'']]],
  ['switch_20s_20daldd_20mpb_87',['SldrDALtchMPBttn models a Slider Double Action LDD-MPB combo switch, a.k.a. Off/On/Dimmer, a.k.a. Off/On/Volume radio switch (&lt;b&gt;S-DALDD-MPB&lt;/b&gt;)',['../C:/Users/DevPadawan/Documents/My Projects/Training Projects/LibsDev_AVR/lib/ButtonToSwitch_AVR/README.md#sldrdaltchmpbttn-models-a-slider-double-action-ldd-mpb-combo-switch-aka-offondimmer-aka-offonvolume-radio-switch-s-daldd-mpb',1,'']]],
  ['switch_20that_20keeps_20the_20on_20state_20since_20the_20moment_20the_20signal_20is_20stable_20debouncing_20process_20plus_20a_20delay_20added_20and_20until_20the_20moment_20the_20push_20button_20is_20released_20or_20until_20a_20preset_20time_20in_20the_20on_20state_20is_20reached_88',['The &lt;b&gt;Time Voidable Momentary Button&lt;/b&gt;, models a switch that keeps the ON state since the moment the signal is stable (debouncing process), plus a delay added, and until the moment the push button is released, or until a preset time in the ON state is reached.',['../C:/Users/DevPadawan/Documents/My Projects/Training Projects/LibsDev_AVR/lib/ButtonToSwitch_AVR/README.md#the-time-voidable-momentary-button-models-a-switch-that-keeps-the-on-state-since-the-moment-the-signal-is-stable-debouncing-process-plus-a-delay-added-and-until-the-moment-the-push-button-is-released-or-until-a-preset-time-in-the-on-state-is-reached',1,'']]],
  ['switches_20library_20buttontoswitch_89',['Buttons to Switches Library (ButtonToSwitch)',['../C:/Users/DevPadawan/Documents/My Projects/Training Projects/LibsDev_AVR/lib/ButtonToSwitch_AVR/README.md#buttons-to-switches-library-buttontoswitch',1,'']]],
  ['switches_20mechanisms_3a_90',['The library implements the following switches mechanisms:',['../C:/Users/DevPadawan/Documents/My Projects/Training Projects/LibsDev_AVR/lib/ButtonToSwitch_AVR/README.md#the-library-implements-the-following-switches-mechanisms',1,'']]],
  ['switches_20that_20keep_20the_20on_20state_20since_20the_20moment_20the_20input_20signal_20is_20stable_20debouncing_20delay_20process_20and_20keeps_20the_20on_20state_20after_20the_20mpb_20is_20released_20and_20until_20an_20event_20un_20latches_20them_20setting_20them_20free_20to_20go_20back_20to_20the_20off_20state_91',['&lt;b&gt;Latched DD-MPBs&lt;/b&gt; are MPBs whose distinctive characteristic is that models switches that keep the ON state since the moment the input signal is stable (debouncing + Delay process), and keeps the ON state after the MPB is released and until an event un-latches them, setting them free to go back to the &lt;b&gt;Off State&lt;/b&gt;.',['../C:/Users/DevPadawan/Documents/My Projects/Training Projects/LibsDev_AVR/lib/ButtonToSwitch_AVR/README.md#latched-dd-mpbs-are-mpbs-whose-distinctive-characteristic-is-that-models-switches-that-keep-the-on-state-since-the-moment-the-input-signal-is-stable-debouncing--delay-process-and-keeps-the-on-state-after-the-mpb-is-released-and-until-an-event-un-latches-them-setting-them-free-to-go-back-to-the-off-state',1,'']]],
  ['switches_20that_20present_20different_20behaviors_20based_20on_20the_20time_20length_20of_20the_20presses_20detected_20and_20the_20sequence_20of_20the_20short_20and_20long_20presses_92',['&lt;b&gt;Double Action Latched DD-MPB&lt;/b&gt; are MPBs whose distinctive characteristic is that models switches that present different behaviors based on the &lt;b&gt;time length&lt;/b&gt; of the presses detected and the &lt;b&gt;sequence&lt;/b&gt; of the short and long presses.',['../C:/Users/DevPadawan/Documents/My Projects/Training Projects/LibsDev_AVR/lib/ButtonToSwitch_AVR/README.md#double-action-latched-dd-mpb-are-mpbs-whose-distinctive-characteristic-is-that-models-switches-that-present-different-behaviors-based-on-the-time-length-of-the-presses-detected-and-the-sequence-of-the-short-and-long-presses',1,'']]],
  ['switches_20that_20while_20being_20pressed_20their_20state_20might_20change_20from_20on_20state_20to_20a_20voided_20state_20due_20to_20different_20voiding_20conditions_93',['&lt;b&gt;Voidable DD-MPBs&lt;/b&gt; are MPBs whose distinctive characteristic is that implement non-latching switches that while being pressed their state might change from &lt;b&gt;On State&lt;/b&gt; to a &lt;b&gt;Voided state&lt;/b&gt; due to different voiding conditions.',['../C:/Users/DevPadawan/Documents/My Projects/Training Projects/LibsDev_AVR/lib/ButtonToSwitch_AVR/README.md#voidable-dd-mpbs-are-mpbs-whose-distinctive-characteristic-is-that-implement-non-latching-switches-that-while-being-pressed-their-state-might-change-from-on-state-to-a-voided-state-due-to-different-voiding-conditions',1,'']]],
  ['switches_3a_94',['The embedded behavior also includes logical replacements for temporary or extraordinary responses that usually need external hardware modifications in electromechanical switches:',['../C:/Users/DevPadawan/Documents/My Projects/Training Projects/LibsDev_AVR/lib/ButtonToSwitch_AVR/README.md#the-embedded-behavior-also-includes-logical-replacements-for-temporary-or-extraordinary-responses-that-usually-need-external-hardware-modifications-in-electromechanical-switches',1,'']]]
